import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
  padding:10px;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-around;
`;
function SearchedProducts() {
  return (
    <Container>
      searched products
    </Container>
  )
}

export default SearchedProducts
